import React from 'react';
import '../App.css';

function Navbar(){

    return(
        <nav>
           <h1>RK</h1>
           <ul className = "navsub">
               <li>Covid-News-Updates</li>
               <li>Indian-Covid-Cases</li>
           </ul>
        </nav>
    );
}

export default Navbar;
